INSERT INTO `info` (`id_info`, `id_user`, `judul`, `isi`, `tanggal`, `gambar`) VALUES
(1, 1, ' Peraturan Menteri Perdagangan R.I. Nomor: 70/M-DAG/PER/12/2013 tentang Pedoman Penataan dan Pembinaan Pasar Tradisional, Pusat Perbelanjaan dan Toko Modern, Bab II Pasal 3 Ayat (1) dan Ayat (3)', '<ol>\r\n<li>Jumlah Pasar Tradisional, Pusat Perbelanjaan dan Toko Modern, serta jarak antara Pusat Perbelanjaan dan Toko Modern dengan Pasar Tradisional atau toko eceran tradisional ditetapkan oleh Pemerintah Daerah setempat.</li>\r\n<li>\r\n<p>Pemerintah Daerah Setempat dalam menetapkan jumlah serta jarak sebagaimana dimaksud pada ayat (1) harus mempertimbangkan :</p>\r\n</li>\r\n</ol><ol style="list-style-type: lower-alpha;">\r\n<li style="list-style-type: none;"><ol style="list-style-type: lower-alpha;">\r\n<li>\r\n<p>tingkat kepadatan dan pertumbuhan penduduk dimasing-masing daerah sesuai data sensus Badan Pusat Statistik (BPS) tahun terakhir;</p>\r\n</li>\r\n<li>\r\n<p>potensi ekonomi daerah setempat;</p>\r\n</li>\r\n<li>\r\n<p>aksesibilitas wilayah (arus lalu lintas);</p>\r\n</li>\r\n<li>\r\n<p>dukungan keamanan dan ketersediaan infrastruktur;</p>\r\n</li>\r\n<li>\r\n<p>perkembangan pemukiman baru;</p>\r\n</li>\r\n<li>\r\n<p>pola kehidupan masyarakat setempat; dan atau</p>\r\n</li>\r\n<li>\r\n<p>jam kerja toko modern yang sinergi dan tidak mematikan usaha toko eceran tradisional di sekitarnya.</p>\r\n</li>\r\n</ol></li>\r\n</ol>', '2016-08-31 11:02:18', 'Permendagri 70m-m-dag-per-12-2013.jpg'),
(2, 1, '  Peraturan Walikota Semarang Nomor 5 Tahun 2013 tentang Penataan Toko Modern Minimarket Kota Semarang, Bab II Pasal 4 Ayat (2) dan Ayat (4)', '<ol>\r\n<li style="text-align: justify;">\r\n<p>Pendirian Toko Modern Minimarket Harus Memenuhi Ketentuan :</p>\r\n<ol style="list-style-type: lower-alpha;">\r\n<li>\r\n<p>Jarak lokasi pendirian toko modern minimarket paling sedikit radius 500 meter dari pasar tradisional;</p>\r\n</li>\r\n<li>\r\n<p>Minimarket boleh berlokasi pada setiap sistem jaringan jalan termasuk sistem jaringan jalan lingkungan pada kawasan pelayanan lingkungan perumahan</p>\r\n</li>\r\n</ol></li>\r\n<li>\r\n<p>Pendirian Toko Modern Minimarket Wajib Memperhatikan :</p>\r\n<ol style="list-style-type: lower-alpha;">\r\n<li style="text-align: justify;">\r\n<p>Kepadatan penduduk;</p>\r\n</li>\r\n<li style="text-align: justify;">\r\n<p>Perkembangan pemukiman baru;</p>\r\n</li>\r\n<li style="text-align: justify;">\r\n<p>Aksesibilitas wilayah (arus lalu lintas);</p>\r\n</li>\r\n<li style="text-align: justify;">\r\n<p>Keberadaan pasar tradisional dan warung/ toko di wilayah sekitar yang lebih kecil daripada toko modern minimarket tersebut.</p>\r\n</li>\r\n</ol></li>\r\n</ol>', '2016-10-25 14:59:58', 'Perwal semarang nomor 5 tahun 2013.jpg');
